import React, { useState } from 'react'
import './Board.css'

const boardSize = 10;
const Board = () => {

  const [board, setBoard] = useState(new Array(boardSize).fill(0).map(row => new Array(boardSize).fill(0)))
  console.log(board)
  return (
    <div className='board'>
      {board.map((row, rowIndex) => (
        <div key={rowIndex} className='row'>
          {row.map((cell, cellIndex) => (
            <div key={cellIndex} className='cell'></div>
          ))}
        </div>
      ))}
    </div>
  )
}

export default Board
